function parseGames(csv:any) {
  const lines = csv.trim().split('\n');
  // Skip the header line
  return lines.slice(1).map((line: any) => {
    const parts = line.split(',');
    return {
      name: parts[1].trim(),
      uid: parts[2].trim(),
      img: ''
    };
  });
}

